import React from "react";
import { Link } from "react-router";
import Hauptseite from "../pages/Hauptseite";
import Hus1 from "../pages/Hus1";
import Hus2 from "../pages/Hus2";
import Infos from "../pages/Infos";


const Navbar = () => {
  return (
      <nav style= {{display: "flex", flexDirection: "row", justifyContent: "space-between"}}>
        <div className="navbar_left"><img className="navbar_logo" src="https://www.svgrepo.com/show/14413/reddit.svg"></img></div>
        <div className="navbar_right">
          <ul className="navbar_navigation-items">
            <li><Link to ="/" element = {<Hauptseite/>}>Übersicht</Link></li>
            <li id="house-menu">Häuser</li>
                    <div className="dropdown-content">
                        <Link to ="/hus1" element = {<Hus1/>}>Hus 1</Link>
                        <Link to ="/hus2" element = {<Hus2/>}>Hus 2</Link>
                    </div>
            <li><Link to ="/infos" element = {<Infos/>}>Informationen</Link></li>
            <li><a href="/contact">Anreise</a></li>
          </ul>
        </div>
      </nav>
  );
}

export default Navbar;
